import React from 'react';
import styled from 'styled-components';

const MainNavigation = styled.nav`
  align-items: center;
  background-color: #323232;
  display: flex;
  flex-flow: row nowrap;
  -webkit-font-smoothing: antialiased;
  height: 56px;
  padding: 0 30px;

`;

const Root = () => {
    return <h1>Root</h1>
};

export default Root;
